import React, {Component} from 'react';
import myContext from "./context";
class Header extends Component {
  render() {
    return (
      <div>
        <h1>姓名：{this.props.NickName}</h1>
        <h1>级别：{this.props.Level}</h1>
      </div>
    );
  }
}

export default Header;
